import React from 'react';
import PropTypes from 'prop-types';

const CounterApp = ({ value }) => {
  return (
    <div>
        <h1>CounterApp</h1>
        <h2> { value } </h2>
        <button onClick={ (e) => { console.log(e) } } >+1</button>
    </div>
  )
}

CounterApp.propTypes = {
    value: PropTypes.number,
}

export default CounterApp;
